import React from "react";

const Leadership = () => {
  const leaders = [
    {
      name: "Shri Dayananda Reddy",
      role: "Managing Director",
      image: "/videos/img11.jpg",
    },
    {
      name: "Smt Pramila M. Nesargi",
      role: "Director",
      image: "/videos/img22.jpeg",
    },
    {
      name: "Smt Prathibha Dayananda",
      role: "Director",
      image: "/videos/img33.jpeg",
    },
    {
      name: "Shri Shiv Shankar Agarwal",
      role: "Director",
      image: "/videos/img44.jpeg",
    },
    {
      name: "Shri Bhavesh Kumar Surana",
      role: "Director",
      image: "/videos/img55.jpg",
    },
  ];

  const regions = [
    "Bengaluru",
    "Tamil Nadu",
    "Andhra Pradesh",
    "Telangana",
    "Delhi",
  ];

  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Our Leadership</h1>
      <p style={styles.subheading}>Meet the team driving our mission forward</p>
      <div style={styles.leadersContainer}>
        {leaders.map((leader, index) => (
          <div key={index} style={styles.card}>
            <div style={styles.imageContainer}>
              <img src={leader.image} alt={leader.name} style={styles.image} />
            </div>
            <h3 style={styles.name}>{leader.name}</h3>
            <p style={styles.role}>{leader.role}</p>
          </div>
        ))}
      </div>

      {/* Regional Presence Section */}
      <div style={styles.regionalContainer}>
        <h2 style={styles.regionalHeading}>Regional Presence</h2>
        <p style={styles.regionalDescription}>
          Our strategic locations across India enable us to serve clients effectively.
        </p>
        <div style={styles.regionsList}>
          {regions.map((region, index) => (
            <React.Fragment key={region}>
              <div style={styles.regionContainer}>
                <span style={styles.regionDot}></span>
                <span style={styles.region}>{region}</span>
              </div>
              {index < regions.length - 1 && (
                <span style={styles.separator}></span>
              )}
            </React.Fragment>
          ))}
        </div>

        {/* Google Maps iframe */}
        <div style={styles.mapContainer}>
          <iframe
            src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d497699.9973874144!2d77.35074421903454!3d12.95384772557775!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bae1670c9b44e6d%3A0xf8dfc3e8517e4fe0!2sBengaluru%2C%20Karnataka!5e0!3m2!1sen!2sin!4v1645451087254!5m2!1sen!2sin"
            width="100%"
            height="300px"
            style={{ border: 0 }}
            allowFullScreen
            loading="lazy"
          ></iframe>
        </div>

        <div style={styles.findUsButton}>
          <a href="#contact" style={styles.findUsLink}>
            Find Us Near You
          </a>
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    textAlign: "center",
    padding: "50px",
    backgroundColor:"#DBF9DB",
  },
  heading: {
    fontSize: "38px",
    color: "#ff8c00", // Orange color
    fontWeight: "bold",
  },
  subheading: {
    fontSize: "18px",
    color: "#6b7280", // Gray color
    marginBottom: "40px",
  },
  leadersContainer: {
    display: "flex",
    justifyContent: "center",
    gap: "20px",
    flexWrap: "wrap",
  },
  card: {
    textAlign: "center",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    marginBottom: "30px", // Space between leader cards
  },
  imageContainer: {
    width: "200px",
    height: "200px",
    borderRadius: "50%", // Circular image container
    overflow: "hidden", // Hide any overflow if the image is larger
    marginBottom: "15px", // Space between image and name
  },
  image: {
    width: "100%",
    height: "100%",
    objectFit: "cover",
  },
  name: {
    fontSize: "20px",
    color: "#585858", // Dark gray color
    margin: "5px 0",
  },
  role: {
    fontSize: "14px",
    color: "#6b7280", // Gray color
  },
  regionalContainer: {
    marginTop: "50px",
    padding: "20px",
    backgroundColor: "#f1f5f9",
    borderRadius: "8px",
  },
  regionalHeading: {
    fontSize: "38px",
    fontWeight: "bold",
    color: "#ff8c00",
  },
  regionalDescription: {
    fontSize: "16px",
    color: "#6b7280",
    marginBottom: "20px",
  },
  regionsList: {
    display: "flex",
    justifyContent: "center",
    gap: "20px",
    flexWrap: "wrap",
    marginBottom: "20px",
    fontSize: "18px",
    color: "#333",
  },
  regionContainer: {
    position: "relative", // To position the dot before the text
    paddingLeft: "20px",  // Space for the dot
  },
  regionDot: {
    position: "absolute",
    left: 0,
    top: "50%",
    transform: "translateY(-50%)",
    width: "8px",         // Size of the dot
    height: "8px",        // Size of the dot
    borderRadius: "50%",  // Make it circular
    backgroundColor: "#ff8c00", // Orange color for the dot
  },
  region: {
    color: "#ff8c00",  // Orange color for the region name
  },
  separator: {
    width: "2px",
    height: "2px",
    borderRadius: "50%",
    backgroundColor: "#3b82f6", // This can remain blue for separators
  },
  mapContainer: {
    marginTop: "20px",
  },
  findUsButton: {
    marginTop: "20px",
  },
  findUsLink: {
    padding: "10px 20px",
    backgroundColor: "#ff8c00",
    color: "white",
    textDecoration: "none",
    borderRadius: "8px",
    fontWeight: "bold",
  },
};

export default Leadership;
